script: |
  super -f text -I q3850.spq | sort > q3850.out

inputs:
  - name: q3850.spq
    data: |
      SELECT col0 * 30 FROM tab1 (FORMAT parquet) AS cor0 WHERE + ( + col1 ) * col2 * - - ( - + col1 ) NOT IN ( - 71 );
  - name: tab1

outputs:
  - name: q3850.out
    data: |
      1530
      2550
      2730
